import React, { Component } from 'react'
import { withRouter } from 'react-router'
import Footer from './Footer'
import Header from './Header'

class Layout extends Component {
  render() {
    return (
        <div>
        <Header/>
            {this.props.children}
        <Footer/>
        </div>
    )
  }
}

export default withRouter(Layout)
